	eval("module.exports = \"<section><h1>Web-Dev<br />Build Tooling</h1><h3>Because the computer is faster than you</h3><p><a href=\\\"https://github.com/SpenserJ/Presentation-YYCJS-Build-Tools\\\" target=\\\"_blank\\\">GitHub.com/SpenserJ/Presentation-YYCJS-Build-Tools</a></p></section><section><h2>Who am I?</h2><ul><li>Spenser Jones</li><li>Senior Integrations Developer @ Aware360</li><li>Lazy developer looking to do more with less code</li><li><a href=\\\"mailto:hello@spenserj.com\\\">hello@spenserj.com</a></li><li><a href=\\\"https://github.com/SpenserJ\\\" target=\\\"_blank\\\">GitHub.com/SpenserJ</a></li></ul></section><section><h2>What can it do?</h2><ul><li>Compile SASS/SCSS/LESS to CSS</li><li>Transform ES2015 and beyond into well-supported JS</li><li>Minify code and images</li><li>Upload assets to S3</li><li>Remove development code in production builds</li><li>Live-reload the browser when you change something</li><li>Edit directly in the Web Inspector</li></ul></section><section><h2>Slide decks too!</h2><p>This slide deck was built with reveal.js and Webpack, and every time I changed a file, it showed up in the browser a split-second later.</p></section><section><h2>Available Tools</h2><p>There are plenty of good tools to choose from, each with different goals.</p><ul><li>Gulp - Use code to manage your tasks and chain your build together.</li><li>Grunt - Configuration may be much easier for designers to jump into.</li><li>Brunch - Focused on building assets, instead of running tasks.</li><li>Webpack - Rapid development and hot-reloading of changes.</li><li>DevTools - Edit in the browser, and your code will change as well.</li><li>And many others</li></ul></section><section><h2>Quick and easy in the browser</h2><p>DevTools already makes it easy to tweak your website, and with a <code>Workspace</code> and <code>file mapping</code>, changes are immediately saved back to your codebase. This is a great way of making quick changes to a static site, and it pairs extremely well with tools like Gulp.</p><p>If you do SASS/SCSS/LESS compilation with Source Maps, it can even modify the original source for you.</p><p><a href=\\\"https://developer.chrome.com/devtools/docs/workspaces\\\" target=\\\"_blank\\\">https://developer.chrome.com/devtools/docs/workspaces</a></p></section><section><h2>Give it a shot!</h2><p>I used the Responsive configuration from <a href=\\\"http://www.initializr.com/\\\" target=\\\"_blank\\\">Initializr.com</a>, but this works with any stylesheet or Javascript file. To launch this example, start a quick server in the <code>example-devtools-workspace</code> folder.</p><pre><code class=\\\"bash\\\">$ npm install -g http-server\\n$ cd example-devtools-workspace\\n$ http-server -p 8081</code></pre><p>Now go to <a href=\\\"http://localhost:8081/\\\" target=\\\"_blank\\\">http://localhost:8081/</a>.</p></section><section><h2>Link your files and tweak away</h2><ul><li>Open DevTools</li><li>Click the settings cog in the top right<ul><li>Navigate to <code>Workspace</code></li><li>Click <code>Add Folder</code></li><li>Choose the <code>example-devtools-workspace</code> folder</li><li>Grant DevTools access to the folder</li><li>Close the Settings modal</li></ul></li><li>Click the <code>Sources</code> tab<ul><li>Open <code>localhost:8081/css/main.css</code></li><li>Right click the code and click <code>Map to File System Resource...</code></li><li>Click <code>main.css</code> and click <code>OK</code> to restart the inspector</li></ul></li><li>Edit the CSS, and refresh the page.</li></ul></section><section><h2>What's that? Vim is better than DevTools, you say?</h2><p>I completely agree! Your editor is your best friend, and tweaking in there may be more comfortable.</p><p>How do you feel about turning</p><p><code>Code->Save->Alt-Tab->Compile->Alt-Tab->Refresh->Repeat</code></p><p>into</p><p><code>Code->Save->Look</code></p></section><section><h2>Automate your workflow</h2><p>With a few dozen lines of code, and a few Gulp modules (there are thousands to do your bidding), it takes just minutes to automate the compilation of code.</p><pre><code class=\\\"javascript\\\">var gulp = require('gulp')\\n  , uglify = require('gulp-uglify')\\n  , concat = require('gulp-concat')\\n  , sass = require('gulp-sass');\\n\\ngulp.task('default', ['sass', 'js'], function () {\\n  gulp.watch('./scss/**/*.scss', 'sass');\\n  gulp.watch('./app/**/*.js', 'js');\\n});\\ngulp.task('sass', function () {\\n  return gulp.src('./scss/style.scss')\\n    .pipe(sass())\\n    .pipe(gulp.dest('./public_html/'));\\n});\\ngulp.task('js', function () {\\n  return gulp.src(['./app/index.js', './app/menu.js', './app/chat.js'])\\n    .pipe(uglify())\\n    .pipe(concat('app.js'))\\n    .pipe(gulp.dest('./public_html/'));\\n});\\n</code></pre></section><section><h2>Gulp Hot-Load</h2><p>Automatically updating the browser when files change simplifies the development flow, but adds to the complexity of your build tools.</p><p>BrowserSync is my preferred way of quickly adding in CSS hot-reloading, and refreshing the browser when the JS changes.</p><pre><code class=\\\"javascript\\\">// ...\\nvar browserSync = require('browser-sync').create();\\n\\ngulp.task('browser-sync', function () {\\n  browserSync.init({\\n    proxy: 'localhost:8080',\\n  });\\n\\n  gulp.watch(['public_html/*.html', 'public_html/*.js']).on('change', browserSync.reload);\\n});\\n\\ngulp.task('sass', function () {\\n  // ...\\n    .pipe(gulp.dest('./public_html/'))\\n    .pipe(browserSync.stream());\\n});\\n\\n// ...\\n</code></pre></section><section><h2>Close, but not perfect</h2><p>Gulp is great for running build tasks and creating production builds of assets, but the gulpfile grows significantly more complex as you add in additional development tooling.</p><p>Perhaps there is a better tool for reflecting changes in the browser?</p></section><section><h2>Webpack to the rescue!</h2><p>When I build out a frontend, Webpack is quickly becoming my tool of choice. Hot-loading stylesheets, javascript, and even images keeps my hands on the keyboard. All I have to do is hit save and look at the browser to see changes jump into action.</p><p>Better yet, the config rarely changes and the rest is done by requiring dependencies, when and where they need to be.</p></section><section><h2>Configuring Webpack</h2><pre><code style=\\\"javascript\\\">var webpack = require('webpack');\\n\\nmodule.exports = {\\n  entry: [\\n    './app/index.js',\\n    'webpack-dev-server/client?http://localhost:8080',\\n    'webpack/hot/dev-server',\\n  ],\\n  output: {\\n    path: './public_html',\\n    filename: 'app.js',\\n  },\\n  plugins: [ new webpack.HotModuleReplacementPlugin() ],\\n  module: {\\n    loaders:[\\n      { test: /\\\\.js$/, loaders: ['babel'] },\\n      { test: /\\\\.scss$/, loaders: ['style', 'css', 'sass'] },\\n    ],\\n  },\\n};\\n</code></pre></section><section><h2>Just require what you need!</h2><pre><code class=\\\"javascript\\\">import slides from './slides.jade';\\ndocument.querySelector('.reveal .slides').innerHTML = slides;\\n\\nimport reveal from 'reveal';\\nimport 'reveal/index.css';\\nimport 'reveal/theme/night.css';\\nreveal.initialize({\\n    controls: true,\\n    progress: true,\\n    history: true,\\n    transition: 'linear',\\n});\\n\\nimport hljs from 'highlight.js';\\nimport 'highlight.js/styles/tomorrow-night.css';\\nhljs.initHighlightingOnLoad();\\n</code></pre></section><section><h2>Time to edit some code</h2><pre><code class=\\\"bash\\\">$ cd example-webpack\\n$ npm install\\n$ npm run hot-dev-server\\n\\n# In another terminal:\\n$ npm run start-dev</code></pre><p>Now open up <a href=\\\"http://localhost:8080/\\\" target=\\\"_blank\\\">http://localhost:8080/</a> and edit some files in <code>app</code>.</p></section><section><h3>You have to learn the rules of the game.</h3><h3>And then you have to play better than</h3><h3>anyone else.</h3><h4>~ Albert Einstein</h4></section>\";//@ sourceMappingURL=data:application/json;base64,");

